  const [movies, setMovies] = useState([])

  useEffect(() => {
    fetch('./cards.json', {
      headers: {
        'Content-Type' : 'application/json',
        'Accept' : 'application/json'
      }
    })
    .then((response) => response.json())
    .then((data) => console.log(data))
  }, [])

  return (
    <div className="App">
      <Header title="Movie Reviews" />
      <Toolbar />
    </div>
  );
}

export default App;
